import "../css/Home.css";
import "../css/BackgroundImage.css";
import {useNavigate} from 'react-router-dom';

const Home = () => {
    const navigate = useNavigate()
    return ( 
        <div className="Home">
            <div className="Container">
                <div>
                <h1> Welcome to QuizIt! </h1>
                <p className="p1"> All your study materials, all in one place. </p>
                <p className="p2"> Study flashcards by yourself or with friends, we don't care. </p>
                <button className="button" onClick={() => navigate("/login")}> Log In </button>
                <button className="button" onClick={() => navigate("/signup")}>Sign Up</button>
                </div>
            </div>
        </div>
    )
}

export default Home;
